import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
const ViewWatch = () => {
    const [watches, setWatches] = useState([]);
    useEffect(() => {
        fetchWatches();
    }, []);

    const swal = require('sweetalert2')
    const fetchWatches = async () => {
        try {
            const response = await axios.get('http://127.0.0.1:8000/dashboard/watches/'); 
            console.log(response.data)
            setWatches(response.data); 
           
        } catch (error) {
            console.error('Error fetching watches:', error);
        }
    };
    function handleDelete(id) {
        if (window.confirm('Are you sure you want to delete this watch?')) {
          fetch(`http://127.0.0.1:8000/dashboard/watches/${id}/delete/`, {
            method: 'DELETE',
            headers: {
              'Content-Type': 'application/json',
            }
          })
          .then(response => {
            if (response.ok) {
                 
            swal.fire({
                title: "Remove Watch Successfully ",
                icon: "error",
                toast: true,
                timer: 6000,
                position: 'top-right',
                timerProgressBar: true,
                showConfirmButton: false
            })
              setWatches(watches.filter(watch => watch.id !== id));
            } else {
              console.error('Error deleting watch:', response.status);
            }
          })
          .catch(error => {
            console.error('Error deleting watch:', error);
          });
        }
      }

    return (
        <div className="main-content">

        <div className="page-content">
            <div className="container-fluid">

                <div className="row">
                    <div className="col-12">
                        <div className="page-title-box d-sm-flex align-items-center justify-content-between">
                            <h4 className="mb-sm-0 font-size-18">Watch View</h4>
                        </div>
                    </div>
                </div>

                <div className="row">
            <div className="col-12">
                <div className="card">
                    <div className="card-body">
                        {/* Header Section */}
                        <div className="row mb-2">
                            {/* Search Box */}
                            <div className="col-sm-4">
                                <div className="search-box me-2 mb-2 d-inline-block">
                                    <div className="position-relative">
                                        <input type="text" className="form-control" placeholder="Search..." />
                                        <i className="bx bx-search-alt search-icon"></i>
                                    </div>
                                </div>
                            </div>
                            {/* Button Section */}
                            <div className="col-sm-8">
                                <div className="text-sm-end">
                                    <button type="button" className="btn btn-success btn-rounded waves-effect waves-light mb-2 me-2">
                                        <i className="mdi mdi-plus me-1"></i> Add New Order
                                    </button>
                                </div>
                            </div>
                        </div>

                        {/* Table Section */}
                        <div className="table-responsive">
                            <table className="table align-middle table-nowrap table-check">
                                <thead className="table-light">
                                    <tr>
                                        {/* Table Headers */}
                                    </tr>
                                </thead>
                                <tbody>
                                    <tr>
                                        {/* Table Data */}
                                    </tr>
                                </tbody>
                            </table>
                        </div>

                        {/* Pagination Section */}
                        <ul className="pagination pagination-rounded justify-content-end mb-2">
                            {/* Pagination Items */}
                        </ul>
                    </div>
                </div>
            </div>
        </div>
        </div> 
    </div>

    
    <footer className="footer">
        <div className="container-fluid">
            <div className="row">
                <div className="col-sm-6">
                    <script>document.write(new Date().getFullYear())</script> Â© React Dashboard.
                </div>
                <div className="col-sm-6">
                    <div className="text-sm-end d-none d-sm-block">
                        Design & Develop by Sarfas
                    </div>
                </div>
            </div>
        </div>
    </footer>
</div>




    );
};

export default ViewWatch;
